import React, {useState,useEffect} from "react";


const Home = ()=>{

    const [Data , setData]=useState({});
    const submit = async ()=>{
        const data = await fetch("/api/Dummy/");
        const dataToJson  = data.json().body;
        setData(dataToJson);
        console.log(Data)
    };

    return (
        <div>Home
        <button onClick={submit}>Click</button>
        </div>
    )
};

export default Home;
